import React from "react";
import logo from "../src/search.svg";
// import "./form.style.css";

const Form = props => {
  return (
    <div className="card-form">
      <form onSubmit={props.loadweather}>
        <div>{props.error ? error() : ""}</div>
        <div className="card-form-row">
          <input
            type="text"
            className="form-control"
            placeholder="City"
            name="city"
            autoComplete="off"
          />
          <button className="card-button">
          <svg className="search-svg" viewBox="0 0 320 70"
       data-init="M160,3 L160,3 a27,27 0 0,1 0,54 L160,57 a27,27 0 0,1 0,-54 M197,67 181.21,51.21"
       data-mid="M160,3 L160,3 a27,27 0 0,1 0,54 L160,57 a27,27 0 0,1 0,-54 M179.5,49.5 179.5,49.5"
       data-active="M27,3 L293,3 a27,27 0 0,1 0,54 L27,57 a27,27 0 0,1 0,-54 M179.5,49.5 179.5,49.5">
    <path className="search-svg__path" d="M160,3 L160,3 a27,27 0 0,1 0,54 L160,57 a27,27 0 0,1 0,-54 M197,67 181.21,51.21" />
  </svg>
          </button>
        </div>
      </form>
    </div>
  );
};

const error = props => {
  return (
    <div className="alert" role="alert">
      Please Enter City!
    </div>
  );
};

export default Form;
